import React, { Component } from 'react';

import {
    BrowserRouter as Router,
    Route,
    Switch
} from "react-router-dom"

import { store } from "../index"
import { fetchUserData, checkUserAuth } from "../../redux/actions/index"

import homeRouter from "./home/homeRouter"
import userRouter from "./user/userRouter"
import serverRouter from "./server/serverRouter"
import notFoundPage from "./misc/notFoundPage"

const HomeRouter = () => {

    (async function () {
        await store.dispatch(fetchUserData)
        await store.dispatch(checkUserAuth)
    })();

    return (
        <Router forceRefresh={true}>
            <Switch>
                <Route exact path="/" component={homeRouter} />
                <Route exact path="/user" component={userRouter} />
                <Route exact path="/user/*" component={userRouter} />
                <Route exact path="/server" component={serverRouter} />
                <Route exact path="/server/*" component={serverRouter} />
                <Route path="*" component={notFoundPage} />
            </Switch>
        </Router>
    );
}

export default HomeRouter;
